    if l == 0:
        return 1
    if a + b <= c or b + c <= a or c + a <= b:
        return 0
    if a + b + c <= l:
        return 2 ** 3
    res = 0
    if a <= l:
        res += 2 ** 2
    if b <= l:
        res += 2 ** 2
    if c <= l:
        res += 2 ** 2
    if a + b <= l:
        res += 2 ** 1
    if b + c <= l:
        res += 2 ** 1
    if a + c <= l:
        res += 2 ** 1
    return res

