def prime\_factors(n):
    prime\_factors = {}
    i = 2
    while i * i <= n:
        if n % i:
            i += 1
        else:
            n //= i
            if i not in prime\_factors:
                prime\_factors[i] = 1
            else:
                prime\_factors[i] += 1
    if n > 1:
