    if a >= 1 and b >= 1 and can_transform(a-1, b-1, c+1, x, y, z):
        return True
    if a >= 1 and c >= 1 and can_transform(a-1, b, c-1, x, y, z+1):
        return True
    if b >= 1 and c >= 1 and can_transform(a, b-1, c-1, x, y, z+1):
        return True
    # If no transformation is possible, return False
